		private static Instruction Decode_00(IByteReader r, ref byte b0, ref byte b1)
		{
			switch (b1 = r.ReadOne())
			{
				case 0x00: return Word(0x0000); // 0x0000
				case 0x01: return Word(0x0001); // 0x0001
				case 0x02: return Stc(sr,r0); // sr,r0
				case 0x03: return Bsrf(r0); // r0
				case 0x04: return Mov_b(r0,at(r0,r0)); // r0,@(r0,r0)
				case 0x05: return Mov_w(r0,at(r0,r0)); // r0,@(r0,r0)
				case 0x06: return Mov_l(r0,at(r0,r0)); // r0,@(r0,r0)
				case 0x07: return Mul_l(r0,r0); // r0,r0
