				case 0x0d: return Mov_w(at(r0,r0),r0); // @(r0,r0),r0
				case 0x0e: return Mov_l(at(r0,r0),r0); // @(r0,r0),r0
				case 0x0f: return Mac_l(at(p(r0)),at(p(r0))); // @r0+,@r0+
