				case 0x15: return Mov_w(r1,at(r0,r0)); // r1,@(r0,r0)
				case 0x16: return Mov_l(r1,at(r0,r0)); // r1,@(r0,r0)
				case 0x17: return Mul_l(r1,r0); // r1,r0
				case 0x18: return Sett(); // 
				case 0x19: return Div0u(); // 
