				case 0x23: return Braf(r0); // r0
				case 0x24: return Mov_b(r2,at(r0,r0)); // r2,@(r0,r0)
				case 0x25: return Mov_w(r2,at(r0,r0)); // r2,@(r0,r0)
				case 0x26: return Mov_l(r2,at(r0,r0)); // r2,@(r0,r0)
